    data: |
      SELECT + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + + col1 IN ( + 50 / ( - 98 ), col2 + - 10, - 76, 32 + 3 );
  - name: tab1

outputs:
  - name: q5759.out
    data: |
      14
      47
      5
